import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const MyVilla = () => {
  const [villaData, setVillaData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchVillas = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/villa/user-villas', { withCredentials: true });
        setVillaData(response.data);
      } catch (error) {
        console.error('Error fetching villa data:', error);
        setVillaData([]);
      }
    };

    fetchVillas();
  }, []);

  const handleGoToMain = () => {
    navigate('/main');
  };

  if (!villaData) {
    return (
      <div>
        등록된 빌라가 없습니다.
        <button onClick={handleGoToMain}>메인 페이지로</button>
      </div>
    );
  }

  return (
    <div>
      <h2>내 빌라</h2>
      {villaData.length === 0 ? (
        <div>
          등록된 빌라가 없습니다.
          <button onClick={handleGoToMain}>메인 페이지로</button>
        </div>
      ) : (
        <ul>
          {villaData.map((villa) => (
            <li key={villa._id}>
              <h3>{villa.villaName}</h3>
              <p>주소: {villa.address}</p>
              <button onClick={() => navigate(`/villa/${villa._id}`)}>상세 보기</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default MyVilla;
